import "./App.css";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import AdminTemplate from "./containers/AdminTemplate";
import HomeTemplate from "./containers/HomeTemplate";
import { routeAdmin, routeHome } from "./routes";
import PageNotFound from "./containers/PageNotFound";
import TopBar from "./components/TopBar";

import TopBarHomeItems from "./components/TopBar/TopBarHomeItems";
import TopBarHomeAuth from "./components/TopBar/TopBarHomeAuth";

function App() {
  const showAdminLayout = (routes) => {
    if (routes && routes.length > 0) {
      return routes.map((item, index) => {
        return (
          <AdminTemplate
            key={index}
            exact={item.exact}
            path={item.path}
            component={item.component}
          />
        );
      });
    }
  };

  const showHomeLayout = (routes) => {
    if (routes && routes.length > 0) {
      return routes.map((item, index) => {
        return (
          <HomeTemplate
            key={index}
            exact={item.exact}
            path={item.path}
            component={item.component}
          />
        );
      });
    }
  };

  return (
    <BrowserRouter>
      <Switch>
        <Route
          path="/top-bar"
          component={TopBar(TopBarHomeItems, TopBarHomeAuth)}
        />
        {showAdminLayout(routeAdmin)}
        {showHomeLayout(routeHome)}

        {/* Không tìm ra trang nào */}
        <Route path="" component={PageNotFound} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
